 showChildrenNavItems>\n					<#assign\n						nav_item_attr_has_popup = \"\"\n						nav_item_caret = \"\"\n						nav_item_css_class = \"lfr-nav-item nav-item\"\n						nav_item_href_link = \"\"\n						nav_item_link_css_class = \"nav-link text-truncate\"\n					/>\n\n					<#if showChildrenNavItems>\n						<#assign\n							nav_item_attr_has_popup = \"aria-haspopup=\'true\'\"\n							nav_item_caret = \'<span class=\"lfr-nav-child-toggle\"><i class=\"icon-caret-down\"></i></span>\'\n							nav_item_css_class = \"${nav_item_css_class} dropdown\"\n							nav_item_link_css_class = \"${nav_item_link_css_class} dropdown-toggle\"\n						/>\n					</#if>\n\n					<#if navItem.isBrowsable()>\n						<#assign nav_item_href_link = \"href=\'${navItem.getURL()}\'\" />\n					</#if>\n\n					<#if navItem.isSelected()>\n						<#assign\n							nav_item_css_class = \"${nav_item_css_class} selected active\"\n						/>\n					</#if>\n\n					<li class=\"${nav_item_css_class}\" id=\"layout_${portletDisplay.getId()}_${portletDisplay.getId()}_${navItem.getLayoutId()}\" role=\"presentation\">\n						<a aria-labelledby=\"layout_${portletDisplay.getId()}_${navItem.getLayoutId()}\" ${nav_item_attr_has_popup} class=\"${nav_item_link_css_class}\" ${nav_item_href_link} ${navItem.getTarget()} role=\"menuitem\">\n							<span class=\"text-truncate\"><@liferay_theme[\"layout-icon\"] layout=navItem.getLayout() /> ${navItem.getName()} ${nav_item_caret}</span>\n						</a>\n\n						<#if showChildrenNavItems>\n							<ul aria-expanded=\"false\" class=\"child-menu dropdown-menu\" role=\"menu\">\n								<@buildChildrenNavItems\n									displayDepth=displayDepth\n									navItem=navItem\n								/>\n							</ul>\n						</#if>\n					</li>\n				</#if>\n			</#list>\n		</ul>\n	</div>\n\n	<@liferay_aui.script use=\"liferay-navigation-interaction\">\n		var navigation = A.one(\'#${navbarId}\');\n\n		Liferay.Data.NAV_INTERACTION_LIST_SELECTOR = \'.navbar-site\';\n		Liferay.Data.NAV_LIST_SELECTOR = \'.navbar-site\';\n\n		if (navigation) {\n			navigation.plug(Liferay.NavigationInteraction);\n		}\n	</@>\n</#if>',0,0,30257,NULL,20159,NULL,26537,'1.0',NULL,0,0),('315ab6f0-fc57-e53c-9f6c-3e5c97e43c28',30259,20195,20155,20159,NULL,'2020-06-11 12:24:14.111000','2020-06-11 12:24:14.111000',20720,0,'NAVIGATION-MACRO-FTL','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Navigering i vanliga makron</Name><Name language-id=\"pt_BR\">Macros de navegação comuns</Name><Name language-id=\"ja_JP\">ナビゲーションの一般的なマクロ</Name><Name language-id=\"fr_FR\">Macros de navigation ordinaires</Name><Name language-id=\"hu_HU\">Navigáció közös makrói</Name><Name language-id=\"de_DE\">Navigation häufige Makros</Name><Name language-id=\"ca_ES\">Macros comunes de navegació</Name><Name language-id=\"ar_SA\">وحدات الماكرو الشائعة للتنقل</Name><Name language-id=\"fi_FI\">Navigoinnin yleiset makrot</Name><Name language-id=\"en_US\">Navigation common macros</Name><Name language-id=\"zh_CN\">导航常用宏</Name><Name language-id=\"es_ES\">Macros comunes de navegación</Name><Name language-id=\"nl_NL\">Algemene navigatiemacro\'s</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Innehåller vanliga makron för navigeringsmenymallar.</Description><Description language-id=\"pt_BR\">Contém macros comuns para o modelo do menu de navegação.</Description><Description language-id=\"ja_JP\">ナビゲーションメニューテンプレート用のマクロを含みます</Description><Description language-id=\"fr_FR\">Contient les macros ordinaires pour les modèles de menu de navigation.</Description><Description language-id=\"hu_HU\">A navigációs menü sablonok közös makróit tartalmazza.</Description><Description language-id=\"de_DE\">Enthält häufige Makros für Navigationsmenüvorlagen.</Description><Description language-id=\"ca_ES\">Conté macros comunes per a les plantilles del menú de navegació.</Description><Description language-id=\"ar_SA\">يحتوي على وحدات ماكرو شائعة لقوالب قائمة التنقل.</Description><Description language-id=\"fi_FI\">Sisältää yleiset navigointivalikkomallien makrot.</Description><Description language-id=\"en_US\">Contains common macros for navigation menu templates.</Description><Description language-id=\"zh_CN\">包含导航菜单模板的常用宏。</Description><Description language-id=\"es_ES\">Contiene macros comunes para plantillas del menú de navegación.</Description><Description language-id=\"nl_NL\">Bevat algemene macro\'s voor navigatiemenusjablonen.</Description></root>','macro',NULL,'ftl','<#macro buildChildrenNavItems\n	displayDepth\n	navItem\n	navItemLevel = 2\n>\n	<#assign\n		portletDisplay = themeDisplay.getPortletDisplay()\n	/>\n\n	<#list navItem.getBrowsableChildren() as childNavigationItem>\n		<#assign\n			nav_child_css_class = \"\"\n		/>\n\n		<#if childNavigationItem.isSelected()>\n			<#assign\n				nav_child_css_class = \"active selected\"\n			/>\n		</#if>\n\n		<li class=\"${nav_child_css_class}\" id=\"layout_${portletDisplay.getId()}_${childNavigationItem.getLayoutId()}\" role=\"presentation\">\n			<a aria-labelledby=\"layout_${portletDisplay.getId()}_${childNavigationItem.getLayoutId()}\" class=\"dropdown-item\" href=\"${childNavigationItem.getURL()}\" ${childNavigationItem.getTarget()} role=\"menuitem\">${childNavigationItem.getName()}</a>\n		</li>\n\n		<#if childNavigationItem.hasBrowsableChildren() && ((displayDepth == 0) || (navItemLevel < displayDepth))>\n			<ul class=\"list-unstyled pl-3\">\n				<@buildChildrenNavItems\n					displayDepth=displayDepth\n					navItem=childNavigationItem\n					navItemLevel=(navItemLevel + 1)\n				/>\n			</ul>\n		</#if>\n	</#list>\n</#macro>\n\n<#macro buildNavigation\n	branchNavItems\n	cssClass\n	displayDepth\n	includeAllChildNavItems\n	navItemLevel\n	navItems\n>\n	<#if navItems?has_content && ((displayDepth == 0) || (navItemLevel <= displayDepth))>\n		<ul class=\"${cssClass} level-${navItemLevel}\">\n			<#list navItems as navItem>\n				<#assign\n					nav_item_css_class = \"lfr-nav-item\"\n				/>\n\n				<#if includeAllChildNavItems || navItem.isInNavigation(branchNavItems)>\n					<#assign nav_item_css_class = \"${nav_item_css_class} open\" />\n				</#if>\n\n				<#if navItem.isSelected()>\n					<#assign\n						nav_item_css_class = \"${nav_item_css_class} selected active\"\n					/>\n				</#if>\n\n				<li class=\"${nav_item_css_class}\">\n					<#if navItem.isBrowsable()>\n						<a class=\"${nav_item_css_class}\" href=\"${navItem.getRegularURL()!\"\"}\" ${navItem.getTarget()}>${navItem.getName()}</a>\n					<#else>\n						${navItem.getName()}\n					</#if>\n\n					<#if includeAllChildNavItems || navItem.isInNavigation(branchNavItems)>\n						<@buildNavigation\n							branchNavItems=branchNavItems\n							cssClass=cssClass\n							displayDepth=displayDepth\n							includeAllChildNavItems=includeAllChildNavItems\n							navItemLevel=(navItemLevel + 1)\n							navItems=navItem.getChildren()\n						/>\n					</#if>\n				</li>\n			</#list>\n		</ul>\n	</#if>\n</#macro>',0,0,30260,NULL,20159,NULL,26537,'1.0',NULL,0,0),('02b3b912-9e93-b22b-f378-0f72bf4b501e',30262,20195,20155,20159,NULL,'2020-06-11 12:24:14.124000','2020-06-11 12:24:14.124000',20720,0,'SPLIT-BUTTON-DROPDOWNS-FTL','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Nedrullningsbara listor med delningsknappar</Name><Name language-id=\"pt_BR\">Dividir menus suspensos de botão</Name><Name language-id=\"ja_JP\">スプリットボタンのドロップダウン</Name><Name language-id=\"fr_FR\">Partager les boutons du menu déroulant</Name><Name language-id=\"hu_HU\">Osztott gomb legördülő elemei</Name><Name language-id=\"de_DE\">Dropdown mit geteilten Schaltflächen</Name><Name language-i