()}\">\n										${entry.getHighlightedTitle()}\n									</a>\n								</div>\n\n								<div class=\"search-results-metadata\">\n									<p class=\"list-group-subtext\">\n										<#if entry.isModelResourceVisible()>\n											<span class=\"subtext-item\">\n												<strong>${entry.getModelResource()}</strong>\n											</span>\n										</#if>\n\n										<#if entry.isLocaleReminderVisible()>\n											<@liferay_ui[\"icon\"]\n												icon=\"../language/${entry.getLocaleLanguageId()}\"\n												message=entry.getLocaleReminder()\n											/>\n										</#if>\n\n										<#if entry.isCreatorVisible()>\n											<span class=\"subtext-item\">\n												&#183;\n\n												<@liferay.language key=\"written-by\" />\n\n												<strong>${htmlUtil.escape(entry.getCreatorUserName())}</strong>\n											</span>\n										</#if>\n\n										<#if entry.isCreationDateVisible()>\n											<span class=\"subtext-item\">\n												<@liferay.language key=\"on-date\" />\n\n												${entry.getCreationDateString()}\n											</span>\n										</#if>\n									</p>\n\n									<#if entry.isContentVisible()>\n										<p class=\"list-group-subtext\">\n											<span class=\"subtext-item\">\n												${entry.getContent()}\n											</span>\n										</p>\n									</#if>\n\n									<#if entry.isFieldsVisible()>\n										<p class=\"list-group-subtext\">\n											<#assign separate = false />\n\n											<#list entry.getFieldDisplayContexts() as fieldDisplayContext>\n												<#if separate>\n													&#183;\n												</#if>\n\n												<span class=\"badge\">${fieldDisplayContext.getName()}</span>\n\n												<span>${fieldDisplayContext.getValuesToString()}</span>\n\n												<#assign separate = true />\n											</#list>\n										</p>\n									</#if>\n\n									<#if entry.isAssetCategoriesOrTagsVisible()>\n										<h6 class=\"search-document-tags text-default\">\n											<@liferay_asset[\"asset-tags-summary\"]\n												className=entry.getClassName()\n												classPK=entry.getClassPK()\n												paramName=entry.getFieldAssetTagNames()\n												portletURL=entry.getPortletURL()\n											/>\n\n											<@liferay_asset[\"asset-categories-summary\"]\n												className=entry.getClassName()\n												classPK=entry.getClassPK()\n												paramName=entry.getFieldAssetCategoryIds()\n												portletURL=entry.getPortletURL()\n											/>\n										</h6>\n									</#if>\n\n									<#if entry.isDocumentFormVisible()>\n										<h6 class=\"expand-details text-default\">\n											<span class=\"list-group-text\" style=\"\">\n												<a href=\"javascript:;\">\n													<@liferay.language key=\"details\" />...\n												</a>\n											</span>\n										</h6>\n\n										<div class=\"hide search-results-list table-details table-responsive\">\n											<table class=\"table\">\n												<thead>\n													<tr>\n														<th class=\"key-column\">\n															<@liferay.language key=\"key\" />\n														</th>\n														<th>\n															<@liferay.language key=\"value\" />\n														</th>\n													</tr>\n												</thead>\n\n												<tbody>\n													<#list entry.getDocumentFormFieldDisplayContexts() as fieldDisplayContext>\n														<tr>\n															<td class=\"key-column table-details-content\">\n																<strong>${htmlUtil.escape(fieldDisplayContext.getName())}</strong>\n															</td>\n															<td class=\"table-details-content\">\n																<code>\n																	${fieldDisplayContext.getValuesToString()}\n																</code>\n															</td>\n														</tr>\n													</#list>\n												</tbody>\n											</table>\n										</div>\n									</#if>\n								</div>\n							</section>\n						</div>\n					<#else>\n						<div class=\"autofit-col\">\n							<div class=\"alert alert-danger\">\n								<@liferay.language_format\n									arguments=\"result\"\n									key=\"is-temporarily-unavailable\"\n								/>\n							</div>\n						</div>\n					</#if>\n				</li>\n			</#list>\n		</#if>\n	</ul>\n</div>\n\n<@liferay_aui.script use=\"aui-base\">\n	A.one(\'#search-results-display-list\').delegate(\n		\'click\',\n		function(event) {\n			var currentTarget = event.currentTarget;\n\n			currentTarget.siblings(\'.search-results-list\').toggleClass(\'hide\');\n		},\n		\'.expand-details\'\n	);\n</@liferay_aui.script>',0,0,30304,NULL,20159,NULL,26537,'1.0',NULL,0,0),('89643dcf-4faf-6689-0d35-099c1c43e342',30306,20195,20155,20159,NULL,'2020-06-11 12:24:14.486000','2020-06-11 12:24:14.486000',26620,0,'SEARCH-RESULTS-CARD-FTL','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Kortlayout</Name><Name language-id=\"pt_BR\">Layout do Cartão</Name><Name language-id=\"ja_JP\">カードレイアウト</Name><Name language-id=\"fr_FR\">Disposition de la carte</Name><Name language-id=\"hu_HU\">Kártyaelrendezés</Name><Name language-id=\"de_DE\">Kartenlayout</Name><Name language-id=\"ca_ES\">Disposició de la targeta</Name><Name language-id=\"ar_SA\">مخطط البطاقة</Name><Name language-id=\"fi_FI\">Kortin Asettelu</Name><Name language-id=\"en_US\">Card Layout</Name><Name language-id=\"zh_CN\">卡片布局</Name><Name language-id=\"es_ES\">Diseño de tarjeta</Name><Name language-id=\"nl_NL\">Kaartlay-out</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visa omslagsbilder, rubriker, författare och sammanfattningar genom att använda kort för blogginlägg.</Description><Description language-id=\"pt_BR\">Exibir imagens da cobertura, títulos, autores e resumos usando cartões para entradas do blog.</Description><Descr