tem_css_class} selected active\"\n						/>\n					</#if>\n\n					<li class=\"${nav_item_css_class}\" id=\"layout_${portletDisplay.getId()}_${navItem.getLayoutId()}\" role=\"presentation\">\n						<a aria-labelledby=\"layout_${portletDisplay.getId()}_${navItem.getLayoutId()}\" ${nav_item_attr_has_popup} class=\"${nav_item_link_css_class}\" ${nav_item_href_link} ${navItem.getTarget()} role=\"menuitem\">\n							<span class=\"text-truncate\"><@liferay_theme[\"layout-icon\"] layout=navItem.getLayout() /> ${navItem.getName()} ${nav_item_caret}</span>\n						</a>\n\n						<#if showChildrenNavItems>\n							<ul aria-expanded=\"false\" class=\"child-menu dropdown-menu\" role=\"menu\">\n								<@buildChildrenNavItems\n									displayDepth=displayDepth\n									navItem=navItem\n								/>\n							</ul>\n						</#if>\n					</li>\n				</#if>\n			</#list>\n		</ul>\n	</div>\n\n	<@liferay_aui.script use=\"liferay-navigation-interaction\">\n		var navigation = A.one(\'#${navbarId}\');\n\n		Liferay.Data.NAV_INTERACTION_LIST_SELECTOR = \'.navbar-site\';\n		Liferay.Data.NAV_LIST_SELECTOR = \'.navbar-site\';\n\n		if (navigation) {\n			navigation.plug(Liferay.NavigationInteraction);\n		}\n	</@>\n</#if>',0,20159,NULL,'2020-06-11 12:24:14.071000',0,0),(30258,20195,20155,20159,NULL,'2020-06-11 12:24:14.090000',20720,0,30256,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Fält i standardstil</Name><Name language-id=\"pt_BR\">Barra estilizada padrão</Name><Name language-id=\"ja_JP\">規定スタイルのバー</Name><Name language-id=\"fr_FR\">Barre par défaut</Name><Name language-id=\"hu_HU\">Alapértelmezett stílusú oszlop</Name><Name language-id=\"de_DE\">Standard-Leiste</Name><Name language-id=\"ca_ES\">Barra amb estil per defecte</Name><Name language-id=\"ar_SA\">شريط افتراضي النمط</Name><Name language-id=\"fi_FI\">Palkki oletustyylillä</Name><Nam