naam weer van elke taal (bijv. Spaans).</Description></root>','ftl','<style>\n	.language-entry-long-text {\n		display: inline-block;\n		padding: 0 0.5em;\n	}\n</style>\n\n<#if entries?has_content>\n	<#list entries as entry>\n		<#if !entry.isDisabled()>\n			<@liferay_aui[\"a\"]\n				cssClass=\"language-entry-long-text\"\n				href=entry.getURL()\n				label=entry.getLongDisplayName()\n				lang=entry.getW3cLanguageId()\n				localizeLabel=false\n			/>\n		</#if>\n	</#list>\n</#if>',0,20159,NULL,'2020-06-11 12:24:14.764000',0,0),(30342,20195,20155,20159,NULL,'2020-06-11 12:24:14.783000',26625,0,30340,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Markeringsruta</Name><Name language-id=\"pt_BR\">Caixa de seleção</Name><Name language-id=\"ja_JP\">セレクトボックス</Name><Name language-id=\"fr_FR\">Sélectionner la case</Name><Name language-id=\"hu_HU\">Jelölje be</Name><Name language-id=\"de_DE\">Auswahlkasten</Name><Name language-id=\"ca_ES\">Selecciona la casella</Name><Name language-id=\"ar_SA\">تحديد مربع</Name><Name language-id=\"fi_FI\">Valintalaatikko</Name><Name language-id=\"en_US\">Select Box</Name><Name language-id=\"zh_CN\">选择框</Name><Name language-id=\"es_ES\">Cuadro de selección</Name><Name language-id=\"nl_NL\">Selectievak</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar en markeringsruta med de valda språken.</Description><Description language-id=\"pt_BR\">Exibe uma caixa de seleção com os idiomas selecionados.</Description><Description language-id=\"ja_JP\">セレクトボックスで選択された言語を表示します。</Description><Description language-id=\"fr_FR\">Affiche une boîte de sélection contenant les langues choisies.</Description><Description language-id=\"hu_