INSERT INTO `LayoutPrototype` VALUES ('a0250c2f-a7f7-59a3-e75d-92b79d94b6c4',20316,20155,20159,'','2020-06-11 12:10:14.000000','2020-06-11 12:10:14.000000','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Blogg</Name><Name language-id=\"pt_BR\">Blog</Name><Name language-id=\"ja_JP\">ブログ</Name><Name language-id=\"fr_FR\">Blogue</Name><Name language-id=\"hu_HU\">Blog</Name><Name language-id=\"de_DE\">Blog</Name><Name language-id=\"ca_ES\">Bloc</Name><Name language-id=\"ar_SA\">المدوّنات</Name><Name language-id=\"fi_FI\">Blogit</Name><Name language-id=\"en_US\">Blog</Name><Name language-id=\"zh_CN\">博客</Name><Name language-id=\"es_ES\">Blog</Name><Name language-id=\"nl_NL\">Blog</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Skapa, redigera och visa bloggar från den här sidan. Utforska ämnen genom att använda taggar och få kontakt med andra medlemmar som bloggar.</Description><Description language-id=\"pt_BR\">Crie, edite e visualize blogs a partir desta página. Explore tópicos utilizando tags e conecte-se a outros membros deste blog.</Description><Description language-id=\"ja_JP\">このページからブログの作成、編集、閲覧ができます。タグを使用して記事を検索したり、ブログの他のメンバーを結びつけることができます。</Description><Description language-id=\"fr_FR\">Créer, éditer et visualiser les blogs de cette page. Explorer les sujets en utilisant des tags et se connecter à d\'autres membres de ce blog.</Description><Description language-id=\"hu_HU\">Hozz létre, szerkessz és tekints meg blogokat erről az oldalról. Fedezd fel a témákat a címkék segítségével és lépj kapcsolatba a többi blog taggal.</Description><Description language-id=\"de_DE\">Erstellen, bearbeiten und ansehen von Blogs dieser Seite. Erkunden Sie Themen mit Hilfe von Tags und verbinden Sie sich mit anderen Mitgliedern, die bloggen.</Description><Description language-id=\"ca_ES\">Crear, editar i veure els blogs d\'aquesta pàgina. Explorar temes fent ús de les etiquetes i connectar-se amb altres membres d\'aquest blog.</Description><Description language-id=\"ar_SA\">قم بإنشاء وتحرير وعرض المدونات من هذه الصفحة. استكشف الموضوعات باستخدام العلامات وتواصل مع الأعضاء الآخرين المدونين.</Description><Description language-id=\"fi_FI\">Luo, muokkaa ja näytä tämän sivun blogit. Selaa aiheita käytämällä tunnisteita ja tutustu muihin tämän blogin kirjoittajiin.</Description><Description language-id=\"en_US\">Create, edit, and view blogs from this page. Explore topics using tags, and connect with other members that blog.</Description><Description language-id=\"zh_CN\">在页面中创建，编辑并且预览博客。通便签导出主题，并也博客中的其他成员联系。</Description><Description language-id=\"es_ES\">Cree, edite y vea blogs desde esta página. Explore los temas usando etiquetas y conecte con otros miembros del blog.</Description><Description language-id=\"nl_NL\">Vanaf deze pagina kunt u blogs aanmaken, bewerken en bekijken. Ontdek onderwerpen aan de hand van tags, en verbind met andere leden die bloggen.</Description></root>','',1,0),('53fcca2c-cbce-ac6c-41da-d23cfb8dab3b',20328,20155,20159,'','2020-06-11 12:10:15.000000','2020-06-11 12:10:15.000000','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Välj en visningssida</Name><Name language-id=\"pt_BR\">Página de Exibição de Conteúdo</Name><Name language-id=\"ja_JP\">コンテンツ表示ページ</Name><Name language-id=\"fr_FR\">Choisir une page d\'affichage</Name><Name language-id=\"hu_HU\">Tartalom megjelenítő olda</Name><Name language-id=\"de_DE\">Anzeigeseite auswählen</Name><Name language-id=\"ca_ES\">Escolliu una pàgina de presentació</Name><Name language-id=\"ar_SA\">اختيار صفحة عرض</Name><Name language-id=\"fi_FI\">Web-sisälllön esityssivu</Name><Name language-id=\"en_US\">Content Display Page</Name><Name language-id=\"zh_CN\">选择显示页</Name><Name language-id=\"es_ES\">Seleccione una página de visualización</Name><Name language-id=\"nl_NL\">Kies een weergavepagina</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Skapa, redigera och utforska webbinnehåll från den här sidan. Sök tillgängligt innehåll, utforska relaterat innehåll med taggar och bläddra i innehållskategorier.</Description><Description language-id=\"pt_BR\">Crie, edite e explore conteúdo web a partir desta página. Pesquise conteúdo disponível, explore o conteúdo relacionado com tags e navegue as categorias de conteúdo.</Description><Description language-id=\"ja_JP\">このページからWebコンテンツの作成、編集ができます。コンテンツの検索、タグを利用した関連するコンテンツの検索と、コンテンツのカテゴリを閲覧できます</Description><Description language-id=\"fr_FR\">Créer, éditer et explorer le contenu web de cette page. Rechercher un contenu disponible, explorer le contenu à l\'aide des tags et parcourir les catégories du contenu.</Description><Description language-id=\"hu_HU\">Hozzon létre, szerkesszen és fedezzen fel webes tartalmat erről az oldalról. Keressen elérhető tartalmat, fedezze fel a kapcsolódó tartalmat címkékkel és böngésszen tartalomkategóriákat.</Description><Description language-id=\"de_DE\">Erstellen, bearbeiten und finden von Webcontent dieser Seite. Durchsuchen Sie verfügbare Inhalte, erkunden Sie ähnliche Inhalte über Schlagwörter und durchsuchen Sie Kategorien.</Description><Description language-id=\"ca_ES\">Crear, editar, i explorar el contingut web des d\'aquesta pàgina. Cercar contingut disponible, explorar contingut relacionat amb les etiquetes i navegar per les categories de contingut.</Description><Description language-id=\"ar_SA\">145/5000</Description><Description language-id=\"fi_FI\">Luo, muokkaa ja tutustu web-sisältöön tältä sivulta. Hae saatavilla olevaa sisältöä, tutustu aiheeseen liittyvään sisältöön tunnisteilla ja selaa sisältöluokkia.</Description><Description language-id=\"en_US\">Create, edit, and explore web content from this page. Search available content, explore related content with tags, and browse content categories.</Description><Description language-id=\"zh_CN\">在此页创建、编辑和浏览 web 内容。搜索可用的内容、探索带有标签的相关内容，并浏览内容类别。</Description><Description language-id=\"es_ES\">Cree, edite y explore contenidos web de esta página. Busque contenido adicional, explore contenido relacionado con etiquetas y hojee las categorías del contenido.</Description><Description language-id=\"nl_NL\">U kunt vanaf deze pagina webinhoud aanmaken, bewerken en ontdekken. Zoek beschikbare inhoud, ontdek gerelateerde inhoud met tag en blader door inhoudscategorieën.</Description></root>','',1,0),('11b8e19f-20ea-fe84-20c8-6e3c1986f8a2',20338,20155,20159,'','2020-06-11 12:10:15.000000','2020-06-11 12:10:15.000000','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Wiki</Name><Name language-id=\"pt_BR\">Wiki</Name><Name language-id=\"ja_JP\">Wiki</Name><Name language-id=\"fr_FR\">Wiki (Panneau de Configuration)</Name><Name language-id=\"hu_HU\">Wikik</Name><Name language-id=\"de_DE\">Wiki</Name><Name language-id=\"ca_ES\">Wiki</Name><Name language-id=\"ar_SA\">ويكي</Name><Name language-id=\"fi_FI\">Wikit</Name><Name language-id=\"en_US\">Wiki</Name><Name language-id=\"zh_CN\">Wiki</Name><Name language-id=\"es_ES\">Wiki</Name><Name language-id=\"nl_NL\">Wiki\'s</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Samarbeta med medlem